import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className='app-wrapper'>
      <header>
        <img src='asd' alt='jopa'/>
      </header>
      <nav>
        <div>
          Profile
        </div>
        <div>
          Messages
        </div>
        <div>
          Main content
        </div>
      </nav>
    </div>
  );
}

export default App;
